public class ChallianeVineyards : QuestClass
{
	static Vector3 p1 = new Vector3(1441.665, 6722.41, 87.83916);
	static int mob1 = 90541;
	static Vector3 p2 = new Vector3(1240.22, 6831.364, 121.115);
	static int mob2 = 90537;
	static Vector3 p3 = new Vector3(1433.429, 7005.435, 90.79688);
	static int mob3 = 90547;
	static List<Vector3> hotspotsPickUp = new List<Vector3>()
	{
		new Vector3(1298.959, 6712.5, 107.4153),
		new Vector3(1396.776, 7144.244, 59.96965),
	};
	public ChallianeVineyards()
	{
		Name = "Challiane Vineyards";
		QuestId.Add(38203);
		Step.AddRange(new[] { 1, 1, 1 });
	}
	public override bool Pulse()
	{
		if (!Questing.ObjectiveComplete(this, 1))
		{
			if (!Questing.Attack(mob1))
				GoToTask.ToPosition(p1);
			return true;
		}
		if (!Questing.ObjectiveComplete(this, 2))
		{
			if (!Questing.Attack(mob2))
				GoToTask.ToPosition(p2);
			return true;
		}
		if (!Questing.Attack(mob3))
			GoToTask.ToPosition(p3);
		return true;
	}
	public override bool PickUp()
	{
		if (Questing.FindNPC(NpcPickUp, hotspotsPickUp))
			return base.PickUp();

		return true;
	}
}

var npc = ObjectManager.GetNearestWoWUnit(ObjectManager.GetWoWUnitByEntry(90406));
if (npc != null && npc.IsValid)
{
	if (npc.InCombat)
	{
		var mob = ObjectManager.GetNearestWoWUnit(ObjectManager.GetWoWUnitAttackables(30));
		if (mob != null && mob.IsValid && mob.IsAlive && mob.IsAttackable)
		{
			Interact.InteractGameObject(mob.GetBaseAddress);
			Fight.StartFight(mob.Guid);
			return true;
		}
	}
	GoToTask.ToPosition(npc.Position, 10);
	return true;
}

