public class OntheBrink : QuestClass
{
	static int _questID = 38015;
	static uint _itemID = 138146;
	static float _minDist = 9;
	static uint _spellId = 214482; // http://www.wowhead.com/spell=214482/radiant-ley-crystal
	static List<Vector3> _hotspots = new List<Vector3>()
	{
		new Vector3(),
		new Vector3(580.2465, 6624.608, 57.83238),
		new Vector3(648.5121, 6717.858, 57.89808),
		new Vector3(614.2483, 6668.945, 60.23647),
		new Vector3(708.4583, 6554.415, 63.7892),
	};
	static List<int> _mobs = new List<int>()
	{
		0,
		107962,
		107963,
		107961,
		107964,
	};
	public OntheBrink()
	{
		Name = "On the Brink";
		QuestId.Add(_questID);
		Step.AddRange(new[] { 1, 1, 1, 1, 0 });
	}
	static void Log(string text)
	{
		Logging.WriteDebug("[On the Brink] " + text);
	}
	public override bool Pulse()
	{
		//4-1-3-2
		if (RunObjective(4))
			return true;
		if (RunObjective(1))
			return true;
		if (RunObjective(3))
			return true;
		if (RunObjective(2))
			return true;

		return true;
	}
	bool RunObjective(int num)
	{
		if (Questing.ObjectiveComplete(this, num))
			return false;

		if (GoToTask.ToPosition(_hotspots[num], _minDist))
		{
			var mob = ObjectManager.GetNearestWoWUnit(ObjectManager.GetWoWUnitByEntry( _mobs[num]));
			if (mob != null && mob.IsValid)
			{
				Log("heal " + mob.Name);
				Interact.InteractGameObject(mob.GetBaseAddress);
				MovementManager.Face(mob);
				Thread.Sleep(Usefuls.Latency);
				ItemsManager.UseItem(_itemID);
				Questing.Wait(3, 4);
				StopCasting();
			}
		}
		return true;
	}
	static void StopCasting()
	{
		Log("stopcasting");
		Lua.LuaDoString("SpellStopCasting()");
	}
	public static void RunStopCastThread()
	{
		Thread t = new Thread(() =>
		{
			while (robotManager.Products.Products.IsStarted)
			{
				if (Conditions.InGameAndConnectedAndAliveAndProductStartedNotInPause)
				{
					if (!Quest.HasQuest(_questID))
						break;

					var me = ObjectManager.Me;
					if (me.IsValid && me.IsAlive && me.IsCast && ObjectManager.Me.CastingSpellId == _spellId && ObjectManager.Me.CastingTimeLeft <= 0)
					{
						StopCasting();
					}
				}
				Thread.Sleep(3000);
			}
		});
		t.Start();
	}
}
